import "./App.css";
import { useEffect, useState } from "react";
import { getNewStoryIds } from "./APICalls/getApiStories";

const App = () => {
  const [newStories, setnewStories] = useState([]);

  useEffect(() => {
    getNewStoryIds().then((stories) => {
      setnewStories(stories);
    });
    console.log(newStories);
  }, []);

  return (
    <div>
      <h1>Hakcer News</h1>
      {newStories.map()}
    </div>
  );
};

export default App;
